release.CE_note:
Le vol. 1 (M10 49083/92) est un cas particulier, comme indiqué plus haut. Selon les bases de données Records.su (2017) et Rockdisco (2008) – seules références qui évoquent ce « premier » volume de la série –, il s’agit de trois récitals donnés à la grande salle du conservatoire de Moskva en 1948, 1951 et 1952, et ce volume aurait été publié beaucoup plus tard que les sept précédents, en 1990. Il serait composé des récitals ou fragments de récitals suivants :
• récital daté 1948-01-05 : Schubert (Impromptu D 899 n° 3 et Impromptu D 899 n° 4). Schumann (Sonate opus 11). Chopin (Polonaise opus 44). Liszt (Sonate S 178). Schubert/Liszt (Der Müller und der Bach, Der Doppelgänger, Auf dem Wasser zu singen et Erlkönig). Voir Vista Vera VVCD-00203 (2009) et Vista Vera VVCD-00204 (2009) pour l’édition sur disque compact ;
• fragment du récital daté 1952-10-10 : Beethoven (Sonate opus 57). Schumann (Carnaval opus 9). Rachmaninov (Étude-tableau opus 39 n° 4 et Étude-tableau opus 39 n° 6). Prokof’ev (Pièce opus 12 n° 3 et Pièce opus 12 n° 7). Rachmaninov (Oriental Sketch et Étude-tableau opus 33 n° 6). Voir Moscow State Conservatoire SMC CD 0020 (1998) pour l’édition sur disque compact ;
• fragment du récital daté 1951-11-26 : Mozart (Fantaisie K 396). Schumann (Fantaisie opus 17). Liszt (Après une lecture de Dante : Fantasia quasi Sonata S 161 n° 7). Rachmaninov (Moment musical opus 16 n° 5 et Moment musical opus 16 n° 2). Skrjabin (Sonate opus 30). Debussy (Serenade of the Doll L 113 n° III). Ljadov (A Musical Snuffbox opus 32). Prokof’ev (Sarcasme opus 17 n° 5). Voir Moscow State Conservatoire SMC CD 0019 (1998) pour l’édition sur disque compact.

